(222, 'Hệ thống Máy chụp cộng hưởng từ (MRI) 1,5 Telsa', 'Signa HDxt', '2005', NULL, 'he-thong-may-chup-cong-huong-tu-mri-1-5-telsa', 'L01', 'R8478', 'active', NULL, 95, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, NULL, '1. Tính năng chung\n- Máy giúp thở chuyên dụng dùng cho cấp cứu, hồi sức tích cực và vận chuyển\n- Có chế độ thở không xâm lấn (NIV)\n- Sử dụng cho người lớn, trẻ em\n- Hoạt động với nguồn khí nén tuốc- bin tích hợp trong máy, có quạt làm mát dành riêng cho tuốc- bin\n- Có chương trình tự kiểm tra máy\n- Cho phép cài đặt mặc định các thông số thở\n- Có tính năng tự động bù khoảng chết\n- Có tính năng tự động bù áp lực: tự động bù áp lực khí quyển trên áp lực đo được hiện tại\n- Có thể dùng nguồn điện ngoài (điện áp thấp) 12V.DC hoặc pin NiMh 12V.DC (Pin hoạt động tối đa 4 giờ)\n- Có cảm biến lưu lượng và hiệu chuẩn tự động (Hiệu chuẩn được bắt đầu bởi người vận hành)\n- Bộ khí dung: Có thể điều chỉnh thông số bù lưu lượng khí dung lên tới 6L/phút ở chế độ thông khí cưỡng bức\n- Có khả năng nâng cấp tính năng theo dõi C)2 của bệnh nhân, tùy chọn công nghệ mainstream hoặc sidestream\n- Có tính năng dự phòng ngưng thở', 480000000, NULL, '2012', NULL, NULL, '2006', '250000000', NULL, NULL, 'Máy chính với các phụ kiện tiêu chuẩn và vật tư tiêu hao kèm theo cho: 01 máy\n- Màn hình màu TFT, 10.4\", cảm ứng: 01 chiếc\n- Van thở ra và cảm biến lưu lượng, sử dụng nhiều lần, có thể hấp tiệt trùng: 01 bộ\n- Bộ dây thở sử dụng nhiều lần: 01 bộ\n- Mặt nạ thở sử dụng nhiều lần: 01 bộ\n- Bộ dây nguồn khí Oxy: 01 bộ\n- Phổi giả: 01 chiếc\n- Ắc quy trong: 01 chiếc\n- Tài liệu hướng dẫn sử dụng: 01 bộ', NULL, 'Dïng siªu ©m ®Ó chÈn ®o¸n ®iÒu trÞ bÖnh nh©n', NULL, NULL, NULL, 0, 0, '2021-04-13 00:00:00', 'Gãy cánh', NULL, NULL, NULL, NULL, '2021-03-13 16:12:40', '2021-04-20 21:20:59'),
