(243, 'Máy chụp X-Quang 2D/3D di động và phụ kiện đi kèm', 'O-ARM O2', '2021', NULL, 'may-chup-x-quang-2d-3d-di-dong-va-phu-kien-di-kem', 'N01-XXXMXQ-13032021-XXX243', 'DDXQ', 'active', 'C', 4, 'Medtronic Navigation, Inc.', 'Mỹ', NULL, NULL, NULL, NULL, 27, 32, 15, 30, NULL, NULL, 'THÔNG SỐ CHỈ TIÊU KỸ THUẬT KỸ THUẬT:\r\nKhối xử lý hình ảnh\r\nẢnh đơn diện 2D: Chiếu xung ở 30 hình/giây\r\nẢnh đa diện 2D: Tới 4 hình 2D từ vị trí cài đặt trước\r\nẢnh khối 3D tiêu chuẩn: \r\n+ Thu thập dữ liệu: < 16 giây (tiêu chuẩn: 14 giây)\r\n+ Số ảnh: 391 ảnh trên 360 độ\r\n+ Thời gian tái tạo ảnh 3D: < 30 giây (tiêu chuẩn: 7 giây)\r\n+ Trường nhìn: 20 cm\r\n+ Độ phân giải: 0,415 x 0,415 x 0,833 mm\r\n+ Kích thước ma trận tái tạo: 512 x 512 x 192\r\nHình ảnh khối 3D\r\nKhối trụ:\r\n+ FOV 20cm: 21,25cm đường kính x 15 cm chiều cao\r\n+ FOV 40cm: 39,7cm đường kính x 15 cm chiều cao\r\nĐộ phân giải: 512 x 512 x 192\r\nNguồn phát tia X\r\nCông suất: Tối đa 32kW\r\nĐộ chính xác lặp lại kVp: ≤ 0,05 CV\r\nĐộ chính xác tuyến tính mAs: <0,05 liền kề; <0,1 không liền kề\r\nBóng phát tia\r\nLoại bóng: Anode quay\r\nCông suất tối đa: 32kW\r\nĐiện áp tối đa: 150V\r\nBộ lọc tia: Tương đương 0,7mm Al\r\nKhả năng trữ nhiệt của Anode: 300kHU (222 kJ)\r\nKhả năng trữ nhiệt của vỏ bóng: 1250kHU (927 kJ)', NULL, NULL, NULL, 20, NULL, NULL, '32000000000', NULL, NULL, 'Máy chính O-arm O2\r\nBộ cắt lớp hình ảnh 3D-HD3D O2 độ nét cao\r\nBộ cắt lớp hình ảnh sọ não 3D\r\nPhần mềm hiển thị hình ảnh O2\r\nBộ chụp nghiêng IsoWag O2\r\nBộ phát tia chuẩn trực hướng tâm 3D\r\nBộ cắt lớp hình ảnh đa trường nhìn\r\nBộ phần mềm tối ưu hóa hình ảnh cho khung lập thể\r\nĐiều khiển từ xa\r\nGiao diện kết nối với hệ thống định vị phẫu thuật\r\nTúi phủ tiệt trùng', NULL, NULL, 20, NULL, NULL, 6, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-13 19:12:26', '2021-03-13 21:24:36'),
(244, 'Máy theo dõi bệnh nhân 5 thông số', 'BPM-1010', '2021', NULL, 'may-theo-doi-benh-nhan-5-thong-so', 'N02-XXXXX3-13032021-XXX244', 'MTDBN', 'active', 'C', 3, 'Bionics Co, Ltd', 'Hàn Quốc', NULL, NULL, NULL, NULL, 28, 34, 14, 30, NULL, NULL, '•	Màn hình \r\n-	Màn hình LCD TFT màu 10.4 inch\r\n-	Độ phân giải : 800x600 SVGA\r\n-	Các đường tín hiệu: 6 dạng sóng ( tiêu chuẩn )/ có tùy chọn tối đa 12 dạng sóng. Các vệt sóng có thể Bật/Tắt \r\n•	Các tham số hiển thị: \r\n-	Hiển thị các thông số: ECG, SpO2, NIBP, 4IBP, RESP, 4TEMP, EtCO2, Multi Gas, ICO, HRV, OXY-CRG, phân tích APG, hiển thị mức ST, mini trend, xem lại ECG, tính liều thuốc, thay đổi màu sắc các kênh, nhiệt độ TD, NIBP trend\r\n•	Tín hiệu điện tim (ECG)\r\n-	Kênh ECG : 3 kênh ( tiêu chuẩn) / 12 kênh EKG ( tùy chọn)\r\n-	Điện cực : 3 hoặc 5 điện cực ( tùy chọn 10 điện cực)\r\n-	 3 đạo trình : I, II, III ( 1 đạo trình 1 thời điểm)\r\n-	 4 đạo trình : I, II, III aVR, aVL, aVF ( 6 đạo trình 1 thời điểm)\r\n-	 5 đạo trình : I, II, III aVR, aVL, aVF, V ( 7 đạo trình 1 thời điểm)\r\n-	10 đạo trình : I, II, III aVR, aVL, aVF, V1, V2, V3, V4, V5, V6 ( tất cả 12 đạo trình của ECG tại một thời điểm)\r\n-	Bộ lọc : Lọc nhiễu tần số cao (50/60Hz), băng thông ( 0.05~80Hz)\r\n-	Khuếch đại: 2.5, 5, 10, 20, 30, 40, tự động mm/mV\r\n-	Tốc độ quét : 6.25, 12.5, 25, 50 mm/s\r\n-	Khoảng đo nhịp tim : 0 đến 300 nhịp/phút, ± 2 nhịp/phút\r\n-	Khoảng tín hiệu vào :0 ±0.5mV đến ±5mV\r\n-	Phát hiện sóng QRS: 0.15mV ~ 0.40mV ( bằng tay)\r\n-	Bảo vệ với máy sốc tim : 300J tại 5000V\r\n-	Chế độ điều hòa nhịp tim : người dùng lựa chọn ( PNF, PNC)\r\n-	Dò loạn nhịp tim : TAC, BRD, PVC, VTAC, ASY, BGM, TGM, VENT,VFIB, CPT, TPT, MIB, Ront\r\n-	Phân tích ST : dải -9.9mm đến 9.9mm/ độ phân dải 0.1mm ( đạo trình : chọn kênh ECG)\r\n-	Tính toán HR : 4~16 sóng QRS\r\n•	Nhịp thở\r\n-	Phương pháp : dùng trở kháng của đạo trình ECG ( có thể lựa chọn)\r\n-	Nhịp thở : 0 ~ 150 nhịp/phút\r\n-	Sai số : ±2% hoặc  ±2 nhịp/phút\r\n-	Lựa chọn đạo trình : I, II\r\n-	Ngưng thở : OFF, 10~60 giây\r\n-	Tốc độ quét : 3.12, 6.25, 12.5, 25, 50 mm/s\r\n-	Độ khuếch đại : x0.25, x0.5, x1, x2, x4, tự động\r\n•	Huyết áp không xâm lấn ( NIBP)\r\n-	Kỹ thuật đo: đo dao động\r\n-	Phạm vi đo :  người lớn 0 ~ 300 mmHg, trẻ em 0 ~ 150 mmHg\r\n-	Chu kỳ đo tự động: 1~ 59 phút, 1~12 giờ\r\n-	Chế độ cấp cứu (STAT) : 5 ~15 phút liên tục\r\n•	Độ bão hòa oxy trong máu (SpO2)  \r\n-	Đầu dò : cảm biến đầu ngón tay dùng nhiều lần\r\n-	Dải đo : 0 ~ 100%\r\n-	Khoảng nhịp mạch:  0 ~ 300 nhịp/phút\r\n-	Độ phân giải : 1%\r\n-	Độ khuếch đại : X0.25, X0.5, X1, X2, X4, tự động\r\n-	Tốc độ quét : 6.25,12.5, 25, 50 mm/s\r\n-	Sai số SpO2  ±2% (70-100%), ±3%(50-69%), không xác định (0-49%)\r\n-	Sai số xung nhịp: 2 nhịp đối với dải từ 0-240 nhịp,  3 nhịp đối với dải từ 241-300 nhịp\r\n-	Cài đặt thời gian phát sóng : 5 giây tối đa ( dựa trên 75 nhịp/phút)\r\n-	Cổng gắn thêm tùy chọn : Nellcor OXI-MAX\r\n•	Nhiệt độ\r\n-	Số kênh: 2 ( tiêu chuẩn), 4 ( tùy chọn)\r\n-	Kiểu: YSI-400 serise\r\n-	Dải đo : 0 ~ 50ºC\r\n-	Sai số: ±0.1 ºC ( 25-50 ºC), ±0.2 ºC ( 0-24.9 ºC)\r\n-	Nhiệt độ TD: Hỗ trợ\r\n•	Cổng mở rộng\r\n-	Cổng RS232, VGA, LAN and Wireless, ECG output, IBP output, thẻ nhớ SD, cổng báo gọi y tá\r\n•	Ngôn ngữ : Tiếng Anh, Pháp, Tây Ba Nha, Đức, Ý, Thổ Nhĩ Kỹ, Séc, Rumani, Bồ Đào Nha ( có thể cập nhật tất cả ngôn ngữ)\r\n•	Trend : \r\n-	Lưu trữ : 30 ngày ( tiêu chuẩn) với tất cả các thông số\r\n-	Dữ liệu thống kê và biểu đồ : 1, 5, 15, 30 phút và 1 giờ\r\n•	Pin\r\n-	Pin Li-on ( DC : 10.8V/2.6A tiêu chuẩn) ( 10.8V/4.4A tùy chọn)\r\n-	Thời gian hoạt động: Tối thiểu: 1 giờ ( tiêu chuẩn)/ tối đa 5 giờ ( tùy chọn 2 bộ )\r\n•	Thông số vật lý\r\n-	Kích thước : 310 x 160 x 290mm (R x S x D)\r\n-	Trọng lượng : 7 Kg\r\n•	Nguồn điện yêu cầu\r\n-	Nguồn vào : 100-240V, 50-60Hz\r\n-	Công suất 120VA', NULL, NULL, NULL, 20, NULL, NULL, '75000000', NULL, NULL, 'Cấu hình cơ bản\r\n·       Máy chính màn hình cảm ứng màu 10.4 inch : 01 chiếc\r\n·       Cáp điện tim : 01 chiếc\r\n·       Bao đo huyết áp người lớn dùng nhiều lần : 01 chiếc\r\n·       Bao đo huyết áp trẻ em dùng nhiều lần: 01 chiếc\r\n·       Cảm biến SpO2 ngón tay dùng nhiều lần : 01 chiếc\r\n·       Điện cực dán: 01 túi\r\n·       Cảm biến nhiệt độ qua da : 01 chiếc\r\n·       Dây nguồn: : 01 chiếc\r\n·       Pin đi kèm máy: : 01 chiếc\r\n·       Tài liệu HDSD tiếng Anh và tiếng Việt : 01 bộ', NULL, 'https://congkhaigiadmec.moh.gov.vn/chi-tiet-thiet-bi?name=M%C3%A1y%20theo%20d%C3%B5i%20b%E1%BB%87nh%20nh%C3%A2n%205%20th%C3%B4ng%20s%E1%BB%91&type=1&idD=7982', 20, NULL, NULL, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-13 19:17:13', '2021-03-13 21:10:34'),
